import React from 'react';

const CampusBus = ({ routes = [] }) => {
  return (
    <div className="campus-bus">
      <h2>Campus Bus</h2>

      {routes.map((schedule, idx) => (
        <div key={idx} className="bus-route">
          <h3 className="route-title">{schedule.route}</h3>
          <div className="time-slots">
            {(schedule.times || []).map((time, index) => (
              <button
                key={index}
                className={`time-slot ${index === 1 ? 'active' : ''}`}
              >
                {time}
              </button>
            ))}
          </div>
        </div>
      ))}

      <button className="show-schedule-btn">Show Bus Schedule</button>
    </div>
  );
};

export default CampusBus;
